INSERT INTO `fw_forum_posts` (`id`, `parent`, `author`, `text`, `publish_date`, `status`) VALUES
(16, 5, 'Алексей', 'теплосберегающие стекла они с каким мехом ? <br>знаете когда я жил в юрте то у нас окна были завешаны оленьями шкурами', 1182181829, '1'),
(15, 5, 'Катерина', 'Алексей, <br>Вам однозначно повезло!!!<br>Вы даже представить себе не можете, как я вам завидую.<br><br>Однако ближе к теме, выходом из вашей ситуации будут Теплосберегающие стекла в составе стеклопакетов или переезд в более теплый климат. <br>', 1182146935, '1'),
(14, 5, '5', 'Специалисты нужен Ваш совет, у меня в квартире очень холодно и даже летом, температура доходит до минус 5 и это ЛЕТОМ !!! Кароче что делать то ? Какой стеклопакет ставить ? Есть ли с подогревом ? <br><br>Очень жду ответа', 1181901913, '1'),
(17, 5, 'Антон', 'Как расшифровывается ваша формула стеклопакета 3*3/16/4м1/8/4 ТорN,и как обозначается стекло триплекс.', 1182234556, '1'),
(18, 5, 'Ольга', '<div class=forum_quote></div>,<br>где (3*3) - это триплекс, (16) - ширина дистанционной рамки, (4м1) - ширина обычного флоат стекла марки м1, (8) - ширина дистанционной рамки, (4 TopN) - это 4 мм низкоэмиссионное стекло, производства компании Glaverbel. Таким образом, речь идет о двухкамерном ударостойком стеклопакете, с высокими теплофизическими свойствами и повышенном уровне шумоизоляции (за счет ПВБ слоя в составе триплекса, являющегося звукопоглотителем).', 1182238061, '1'),
(21, 6, '11', 'Что можно узнать от &quot;грамотного&quot; продавца консультанта.', 1182240543, '1'),
(22, 6, '11', '- Триплекс используется исключительно в автомобилях, его не ставят в стеклопакеты окон, не встречала в своей практике использование триплексов в квартирах,<br>- Лучше стекла с пленкой - ничего нет!<br>- Триплекс не используем практически никогда – зачем платить больше, если все бьется?  <br>- Вам достаточно К стекла, а Low-E стекла – очень дорогие,<br>- Низкая эмиссия - солнцеотражающая пленка в стекле, типа прослойка,<br>- Так называемое теплосберегающее стекло – фуфло,<br>Амальгама в энергосберегающих стеклах со временем отслаивается и слезает. Надо понимать, что все это рекламные штучки.<br>', 1182240635, '1'),
(28, 7, '30', 'проба проба проба<br><br> андрю, ждем енглиш)))', 1203276810, '1'),
(29, 7, '30', 'Добро пожаловать, blew, на форум компании «СТиС»!<br><br><br>че за писец.... <br><br>)))))))))))))))))))))))))))))))))<br><br><br>на самом деле, спс те андрюх))))', 1203276928, '1'),
(30, 7, 'blew', 'андрюха, не спи!!!!!!!!!!!!!!<br>', 1203281216, '1'),
(31, 7, 'blew', 'андрюх, а спички в глаза реально вставить??? а то оч спать хочется...', 1203283166, '1'),
(33, 7, 'test', 'форум еще сырой :))', 1203327202, '1'),
(34, 7, 'blew', 'эндрю!!!!!!!!!!! нужон форум!!!!!!!!!!!', 1203333973, '1'),
(35, 7, 'blew', 'эндрю!!!!!!!!!!! нужон форум!!!!!!!!!!!', 1203333980, '1'),
(36, 7, 'Dj-JonyXak', 'blew! Ну чё ты тупишь?! Тебе ж написали что форум еще сырой, писать многа не надо (от этого ничего не измениться:))... Лучше дать админу денег на пиво и закус, а потом пообещать еще... Чтоб был стимул быстрее сделать нормальный форум:)<br><br>З.ы. Дезайн на 5, задумка на 5, а движок пока на 2!:)))))))))))', 1203334285, '1');
