(289, 10, 11, 1, 'home', '<div class="banners">\r\n<div class="banners__slider">\r\n<div id="banners__slider_left-button" class="banners__slider_left-button g-hidden"></div>\r\n<div id="banners__slider_right-button" class="banners__slider_right-button g-hidden"></div>\r\n<div id="banners__slider__item-1" class="banners__slider__item">\r\n<div class="banners__slider__item_text">\r\n<div><a href="#">РАСПРОДАЖА ДЖИНСОВ <span class="icon icon-arrow-link-big">&nbsp;</span></a></div>\r\n</div>\r\n<img src="../templates/img/picture_main-big.jpg" alt="" /></div>\r\n<div id="banners__slider__item-2" class="banners__slider__item g-hidden">\r\n<div class="banners__slider__item_text">\r\n<div><a href="#">ЕЩЕ РАСПРОДАЖА ДЖИНСОВ <span class="icon icon-arrow-link-big">&nbsp;</span></a></div>\r\n</div>\r\n<img src="../templates/img/picture_main-big.jpg" alt="" /></div>\r\n<div id="banners__slider__item-3" class="banners__slider__item g-hidden">\r\n<div class="banners__slider__item_text">\r\n<div><a href="#">РАСПРОДАЖА ДРУГИХ ДЖИНСОВ </a></div>\r\n</div>\r\n<img src="../templates/img/picture_main-big.jpg" alt="" /></div>\r\n</div>\r\n<div class="banners__second-line">\r\n<div class="banners__second-line__first">\r\n<div class="banners__second-line__item_text">\r\n<div><a href="#">ЛИКВИДАЦИЯ ЛЕТА </a></div>\r\n</div>\r\n<img src="../templates/img/picture_main-2.jpg" alt="" /></div>\r\n<div class="banners__second-line__second">\r\n<div class="banners__second-line__item_text">\r\n<div><a href="#">ВСТРЕЧАЕМ ОСЕНЬ 2015 </a></div>\r\n</div>\r\n<img src="../templates/img/picture_main-3.jpg" alt="" /></div>\r\n</div>\r\n<div class="banners__categories">\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat1.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Пальто</a></div>\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat2.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Куртки</a></div>\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat3.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Брюки</a></div>\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat4.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Жилеты</a></div>\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat5.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Толстовки</a></div>\r\n<div class="banners__categories__item">\r\n<div class="banners__categories__item_image"><img src="../templates/img/picture_main_cat6.jpg" alt="" /></div>\r\n<a class="banners__categories__item_name" href="#">Трикотаж</a></div>\r\n<div class="banners__categories__item banners__categories__item--double">\r\n<div class="banners__categories__item_image--noname"><a href="#"><img src="../templates/img/picture_main_cat7.jpg" alt="" /></a></div>\r\n</div>\r\n</div>\r\n</div>', 'Главная', '', '', '', '', 'page', '', '{if $page_content}{eval var=$page_content.text|stripslashes}{/if}', 'index.html', '1', 'all', 'all', '1', '1', '0', 10, 0, 'documents_list.html', '', ''),
(290, 12, 13, 1, 'about_shop', '', 'О магазине', 'О магазине', '', '', '', 'page', '', '<div class="text">\r\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\r\n\r\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\r\n</div>', 'index.html', '1', 'all', 'all', '1', '1', '0', 10, 0, 'documents_list.html', 'О магазине', ''),
(291, 14, 15, 1, 'dostavka', '<p>Некоторые наши коллеги, берутся доставлять товар собственными силами, мы - нет.<br />Мы понимаем, что не сможем обеспечить такого уровня комфорта клиентам при доставке, который сможет обеспечить крупная курьерская компания, поэтому мы сотрудничаем с одной такой компанией.</p>\r\n<p>Мы гордимся тем, что постоянно улучшаем условия для клиентов, от подбора товара, до его покупки и доставки.</p>\r\n<p><strong>ВНИМАНИЕ:</strong> Мы осуществляем доставку только в пределах Москвы, не далее 5км за МКАД.</p>\r\n<ul>\r\n<li>Стоимость доставки в пределах МКАД &ndash; 300 рублей</li>\r\n<li>Стоимость доставки за МКАД (не более 5 км.) &ndash; 350 рублей</li>\r\n<li>При заказе на сумму от 5000 руб. &ndash; доставка бесплатно</li>\r\n<li>Заказы от 8кг &ndash;&nbsp;самовывоз или срочная доставка</li>\r\n<li>Самовывоз - бесплатно (Пн-Пт с 10 до 19, Сб с 12 до 17), адрес: г. Москва, Волгоградский проспект, д. 32, корп. 8</li>\r\n</ul>\r\n<p><strong>Срочная доставка</strong> - для вашего удобства мы можем доставить товар (в том числе заказы весом более 8 кг.) в тот же день с 20 до 23 часов - стоимость доставки 400 рублей.</p>\r\n<h2>Пункт самовывоза</h2>\r\n<p>Проезд: станция метро Волгоградский проспект (первый вагон в сторону области), из стеклянных дверей подъем налево.<br /> Идти вдоль волгоградского проспекта до здания с аркой, зайти под арку и идти прямо, справа будет здание (д. 32, корп. 8) с множеством кафе, столовых и прочим, пройти примерно 2/3 здания пока на стеклянных дверях не увидите вывеску "Курьерская компания МИГ", зайти внутрь и следовать указателям.</p>', 'Доставка', 'Условия доставки', '', 'Условия доставки', 'Условия доставки товаров магазина SHOP-TOY', 'page', '', '<div class="text">\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\n\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\n</div>', 'index.html', '1', 'all', 'all', '1', '1', '0', 10, 0, 'documents_list.html', 'Доставка', ''),
(292, 16, 17, 1, 'skidki', '', 'Скидки', '', '', '', '', 'page', '', '<h1>{if $page_content.label}{$page_content.label|strip_tags|stripslashes}{else}{$page_content.name|strip_tags|stripslashes}{/if}</h1>\r\n<div class="cattext">{if $page_content}{eval var=$page_content.text|stripslashes}{/if}</div>\r\n\r\n{$subpages}\r\n\r\n{$documents}', 'index.html', '0', 'all', '', '1', '1', '0', 10, 0, '', 'Скидки', '0'),
(294, 18, 19, 1, 'contacts', '', 'Контакты', 'Контактная информация для связи с магазином SHOP-TOY', '', 'Контактная информация магазина shop-toy.com', 'Контактная информация магазина shop-toy.com', 'page', '', '<div class="text">\n<h1>{$page_content.name|strip_tags|stripslashes}</h1>\n\n{if $page_content}{eval var=$page_content.text|stripslashes}{/if}\n</div>', 'index.html', '1', 'all', 'all', '1', '1', '0', 10, 0, 'documents_list.html', 'Контакты', ''),
